import React, { Component } from "react";
import axios from "axios";
import {Form, FormGroup, Label, Input, Col} from 'reactstrap';

class Complete extends Component {
    constructor(props){
        super(props);

        this.state = {
            task: this.props.task
        }
    }
}

export default Complete
